import React, { useState } from "react";
import Dialog from "@material-ui/core/Dialog";
import DialogContentText from "@material-ui/core/DialogContentText";
import DialogTitle from "@material-ui/core/DialogTitle";
import DialogActions from "@material-ui/core/DialogActions";
import DialogContent from "@material-ui/core/DialogContent";
import Button from "@material-ui/core/Button";

function FrontEnd() {
  const [open, setOpen] = React.useState(false);

  const handleClickToOpen = () => {
    setOpen(true);
  };

  const handleToClose = () => {
    setOpen(false);
  };

  return (
    <div stlye={{}}>
      <table className="table table-bordered">
        <thead>
          <tr>
            <th>week</th>
            <th>courseName</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>1 - 2</td>
            <td>React fundamenals and Hooks</td>
            {/* <td onClick={handleOpenModal}>
              Open Dialog
            </td>
            <Dialog isOpen={isOpen} onClose={handleCloseModal}>
              <h1>Modal Title</h1>
              <p>Modal Content Goes Here</p>
            </Dialog> */}

            <td>
              <button>viewresource</button>
            </td>
          </tr>
          <tr>
            <td>2 - 4</td>
            <td>React Redux</td>
            <td>
              <button>Addresource</button>
              <button>viewresource</button>
            </td>
          </tr>
          <tr>
            <td>5 - 6</td>
            <td>Unit Testing using RTL</td>
            <td>
              <button onClick>Addresource</button>
              <button>viewresource</button>
            </td>
          </tr>
          <tr>
            <td>7 - 8</td>
            <td>Project</td>
          </tr>
        </tbody>
      </table>
    </div>
  );
}

export default FrontEnd;
